script: |
  super -f text -I q7100.spq | sort > q7100.out

inputs:
  - name: q7100.spq
    data: |
      SELECT ALL ( - 29 ) AS col2 FROM tab0 (FORMAT parquet) WHERE NOT ( - col1 * - 34 ) IN ( 96 * 68 - 0 * + col0 );
  - name: tab0

outputs:
  - name: q7100.out
    data: |
      -29
      -29
      -29
